import { StyleSheet } from "react-native";
import { color } from "react-native-reanimated";

const styles = StyleSheet.create({
  btnClickContain: {
    flexDirection: "row",
    padding: 5,
    marginTop: 5,
    marginBottom: 5,
  },
  btnContainer: {
    flex: 1,
    flexDirection: "row",
    alignItems: "center",
    height: 30,
  },
  btnIcon: {
    height: 20,
    width: 20,
  },
  btnText: {
    fontSize: 16,
    marginLeft: 10,
    color: "#fff",
  },
  loader: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
  producticones: {
    // Add your styles for the container view here
    width:'20%',
    position:'absolute',
    resizeMode:'contain',
    zIndex: 2,
    right:15,
    top:15
  },
  icon: {
    width: "100%",
    fontSize: 20,
    textAlign: "right",
    color: "red",

    // Add other icon styling here
  },
  disabledIcon: {
    width: "100%",
    color: "black",
    fontSize: 20,
    textAlign: "right",

    // Add styles for disabled icon here
  },
  modalContainer: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "rgba(0, 0, 0, 0.5)", // Semi-transparent black background
  },

  modalContent: {
    width: "100%", // Adjust the width as needed
    backgroundColor: "#fff",
    borderRadius: 10,
    padding: 10,
    marginTop: 25,
    marginBottom: 25,
  },
});

export default styles;
